import React, { Component} from "react";

class App extends Component {
  constructor() {
    super();
    this.state = {
      title: 'original'
    }
  }

  componentDidMount() {
    fetch('/api')
      .then(res => res.json())
      .then(data => this.setState({
        title: data.title
      }))
  }

  render() { 
    return (
      <div>
        <h1>{this.state.title}</h1>
      </div>
    );
  }
}

export default App;
